import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Product Name');

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for the wishlist link and click it
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    await page.click('a:has-text("Your Wish List")');

    // Take a screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_wishlist.png'));

    // Verify the wishlist page loaded
    const wishlistHeader = await page.waitForSelector('h2:has-text("Your Wish List")', { timeout: 5000 });
    const headerText = await wishlistHeader.innerText();

    return {
      success: true,
      action: "Added product to wishlist and navigated to wishlist page",
      extractedData: { headerText },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
